import './App.css';
import React from "react";
import {BrowserRouter,
  Routes,
  Route,
  Link
} from "react-router-dom";
import Navbar from './components/Navbar';
import Home from './components/Home';

function App() {
  return (

    <BrowserRouter>

      <div className="App">

        <Routes>
          <Route path="/" element={<Navbar />} />
          <Route path="/" element={<Home />} />
        </Routes>

      </div>
    </BrowserRouter>
  );
}

export default App;
